def get_hl7_messages() -> list[str]:
    messages: list[str] = []
    for raw in MESSAGES_RAW:
        # Normalize to CR-only segment separators and guarantee trailing CR
        normalized = raw.strip().replace("\r\n", "\n").replace("\n", "\r")
        if not normalized.endswith("\r"):
            normalized = normalized + "\r"
        messages.append(normalized)
    return messages
